import React,{ Component } from "react";
//import items from './items'
class App extends Component{
  render(){
  const Users = () => {
    const data = [
      { id: 1, name: "John Doe" },
      { id: 2, name: "Victor Wayne" },
      { id: 3, name: "Jane Doe" }
    ];
  };


  return (
    <div className="users">
      {data.map((Users) => (
        <div className="Users">{Users}</div>
      ))}
    </div>
  );

  }
}
export default App;
